import React from 'react';
import Button from 'react-bootstrap/Button';

function Form() {

    return(
        <div className='input-form'>
            <div>
                <input 
                    type='text'
                    className='input-field'

                />
                <Button variant="primary" type='submit'><i class="fas fa-plus"></i></Button>{' '}

            </div>
        </div>
    )
}


export default Form;
